import React, { Component } from 'react';
import api from './Api';


class Apicon extends Component{
    state= {
        Nomes:"",
        Descricao:"",
        DataInscricao:"",
        UltimoUpdate:"",
    }

    async componentDidMount (){
        const response = await api.get('')
        console.log(response.data)
        this.setState({ Nomes: response.data})
    }
    

    render() {

        const { nome } = this.state.Nomes.replaceAll("\"","").replaceAll("{","").replaceAll("}","").replaceAll(",", " ");
        
        return (
            <div>
                <h1>Lista da Api</h1>
        <h4>{this.state.Nomes.replaceAll("\"","").replaceAll("{","").replaceAll("}","").replaceAll(",", "\n")}</h4>
            </div>
        );
    }
}
export default Apicon
